import React, { useEffect, useState } from "react";
import "./Client.css";


const Clients = [
  { name:clients.name, email: "ishannt@gmail.com", phone: "1234567890" },
  
];

function Client() {
 
  const [clients, setClients] = useState(Clients);
  useEffect(()=>{
    const api1=fetch('http://localhost:9001/Client/').then((res)=>{
      return res.json()
    }).then((data)=>{
      console.log('this is data',data);
      setClients(data);
    }).catch((error)=>{
      console.log(error)
    })
  },[])


  

  return (
    <div className="Client">
      <h1>Client List</h1>
      <table>
        <thead>
          <tr>
            
            <th>Name</th>
            <th>Email</th>
            <th>Phone</th>

          </tr>
        </thead>
        <tbody>
          {/* Render each client */}
          {clients.map(client => (
            <tr key={client.id}>
              <td>{client.name}</td>
              <td>{client.email}</td>
              <td>{client.phone}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Client;
